    img: <img class="catalog__item-img" src={oftal} alt="сенатмед senatmed" />,
    imgItem: <img class="catalog__item-img" src={oftal} alt="сенатмед senatmed" />,
    title: 'Офтальмологическое оборудование',
    titleItem: <>Офтальмологическое <br/> оборудование</>,
    description: 
    <h5 className="catalog-page-text" data-aos="zoom-in" data-aos-duration="1000">
        ООО «Сенатмед» поставляет приборы для офтальмологии, которые
        можно использовать для диагностики в условиях кабинета, а также
        для проведения различных лечебных мероприятий. <br /> Мы предлагаем
        аппаратуру производителей с мировым именем. <br /> На оборудование мы
        предоставляем гарантию от 3 лет. Обеспечиваем постгарантийное
        обслуживание. <br /><br /> Чтобы купить оснащение для офтальмологического
        кабинета, свяжитесь с офисом ООО «Сенатмед» в Москве по телефону
        +7 (926) 579-03-93 или заполните форму обратной связи ниже.
    </h5> 
  },
